import React from 'react';

class ActionButtons extends React.Component
{
    render() {
        return (
            <div className="row-md-4 align-self-center">
                <button type="button" className="btn btn-primary m-3" onClick={() => {this.props.callPostAPI()}} style={{float:"left"}}>Solve</button>
                <button type="button" className="btn btn-danger m-3" onClick={() => {this.props.clearGrid()}} style={{float:"right"}}>Clear Grid</button>
            </div>
        );
    }
}

export default ActionButtons;
